    - content: >-
        Intercepted Communications.

        Unencrypted, location traced.


        Transcript:


        Highlighted Section:


        The Stormwalker:

        Supplies are running low, our plasma generators have completely run dry and we only have a day of food left to sustain us. We've managed to generate enough power with scraps to send this one message.


        We are currently trapped on Imaol-6, a barren arctic desert with zero natural resources. Our ship is entirely undamaged however we lack any fuel to power it sufficiently for takeoff. If we do not recieve aid in the next week we will perish.


        Coordinates are 221- *Unintelligible* -8- *Static*


        Communications cut

        Reason: Power lost.


        Transcript end.
      type: Paper
