    - content: >-
        Designer Proposition: The Stormwalker


        A large, dense ship with heavy frontal plating for weathering any and all damage head on. Intended for use in asteroid fields, though it could certainly prove useful in general combat provided the enemy doesn't flank the cruiser and attack the relatively unarmored back.

        The ship comes with a full sized gravity generator, along with plenty of systems to keep the crew operating, including standard long term use contents (Medical bay, engineering room, bar, armory, cryopods.), but also various additional sections (Janitorial room, EVA storage, Tool storage, dedicated atmospherics room, dedicated ammunition storage). This ship will be very large and costly to produce, but if several were made it could prove to be an integral component in the %%%%Ruby%%%%%%%% fleet.
      type: Paper
